import React from 'react';
import '../App.css';
import api from "../actions/api.js";

class Users extends React.Component {

    constructor(props){
        super(props);
        this.state ={
            users:[],
            isLoaded: false,
        }
    }

    user(){
        const users=[];
        api.registerUser().fetchAll().then(res => {
            res.data.filter( user => user.email!==localStorage.getItem('userEmail'))
            .then(filterData => res.json())
            .then(json =>{
                this.setState({
                    isLoaded: true,
                    users: json,
                })
            })

