                                            </tr>
                                        </thead>
                                        <tbody>
                                        {
                                            console.log(this.user())
                                        }
                                            <tr>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            );
        }
    }
}

export default Users;
